const FloatingNavBar = () => {
    return (
      <div className="fixed inset-x-0 bottom-0 flex justify-center bg-slate-800 rounded-lg mx-64 mb-6">
      <div class="container mx-auto">
      <ul className="text-white space-x-3 items-center">
      <li className="inline-block"><h1>TITLE1</h1>      </li>
      <li className="inline-block"><h1>TITLE2</h1>      </li>
      <li className="inline-block"><h1>TITLE3</h1>      </li>
      <li className="inline-block"><h1>TITLE4</h1>      </li>

      </ul>
        
      </div>
    </div>
    );
  };
  export default FloatingNavBar;
